import './CostItem.css'

function CostItem() {

    const costDate = new Date(2024, 2, 23);
    const costDescription = 'Fridge';
    const costPrice = 5.3; 

    return (
        <div className='cost-item'>
            <div>{costDate}</div>
            <div className='cost-item__description'>
                <h2>{costDescription}</h2>
                <div></div>
            </div>
            <div className='cost-item__price'>${costPrice}</div>
        </div>
    );  
}

export default CostItem;
